import "./index.css";

const TodoItem = (props) => {
  const { todoDetails } = props;
  const { task, date } = todoDetails;

  return (
    <div className="todoListItem">
      <h1>{task}</h1>
      <p>{date}</p>
    </div>
  );
};

export default TodoItem;
